import "./App.css";
import "./styles/style.scss";

import Footer from "./components/Common-components/Footer";
import Home from "./pages/Home";
import Login from "./components/Login-page/Login";
import Register from "./components/Register-page/Register";
import NotFound from "./pages/NotFound";
import Iphone from "./pages/Iphones";
import Ipad from "./pages/Ipads";
import Mac from "./pages/Macs";
import Applewatch from "./pages/Applewatches";

import { Route, Router, Routes, Switch } from "react-router-dom";
import { createContext, useState, useEffect } from "react";
import Profile from "./pages/Profile";
import ProductPage from "./components/Product-page/Product";
import Verification from "./components/Register-page/Verification";
import { useSelector } from "react-redux";

function App() {
  const url = "http://localhost:8080/product";

  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);
  const [totalPages, setTotalPages] = useState(0);
  const [page, setPage] = useState(0);
  const [size, setSize] = useState(9);
  const [token, setToken] = useState("");

  const memory = useSelector((state) => state.memory.memory);
  const model = useSelector((state) => state.model.model);
  const price = useSelector((state) => state.price);
  const diagonal = useSelector((state) => state.diagonal.diagonal);

  useEffect(() => {
    setIsLoading(true);
    fetch(url + "/all?page=" + page + "&size=" + size + "&token=" + token)
      .then((res) => {
         return res.json();
      })
      .then((array) => {
        setData(array.content);
        setIsLoading(false);
        setTotalPages(array.totalPages);
      });
  }, [page, size, token]);

  useEffect(() => {
    setIsLoading(true);
    fetch(
      url +
        "/category?page=" +
        page +
        "&size=" +
        size +
        "&model=" +
        model +
        "&memory=" +
        memory +
        "&price=" +
        price +
        "&diagonal=" +
        diagonal +
        "&token=" +
        token
    )
      .then((res) => {
        return res.json();
      })
      .then((array) => {
        setData(array.content);
        setIsLoading(false);
        setTotalPages(array.totalPages);
      });
  }, [page, size, memory, model, price, diagonal, token]);

  return (
    <>
      <Routes>
        <Route path="/" element={<Home></Home>}></Route>
        <Route path="/login" element={<Login></Login>}></Route>
        <Route path="/register" element={<Register></Register>}></Route>
        <Route path="/verify" element={<Verification></Verification>}></Route>
        <Route path="*" element={<NotFound></NotFound>}></Route>
        <Route
          path="/iPhones"
          element={
            <Iphone
              data={data}
              isLoading={isLoading}
              totalPages={totalPages}
              onCLickPage={(page) => setPage(page)}
              onClickSize={(size) => setSize(size)}
              setToken={(token) => setToken(token)}
            ></Iphone>
          }
        ></Route>
        <Route
          path="/iPads"
          element={
            <Ipad
              data={data}
              isLoading={isLoading}
              totalPages={totalPages}
              onCLickPage={(page) => setPage(page)}
              onClickSize={(size) => setSize(size)}
              setToken={(token) => setToken(token)}
            ></Ipad>
          }
        ></Route>
        <Route
          path="/macs"
          element={
            <Mac
              data={data}
              isLoading={isLoading}
              totalPages={totalPages}
              onCLickPage={(page) => setPage(page)}
              onClickSize={(size) => setSize(size)}
              setToken={(token) => setToken(token)}
            ></Mac>
          }
        ></Route>
        <Route
          path="/applewatches"
          element={
            <Applewatch
              data={data}
              isLoading={isLoading}
              totalPages={totalPages}
              onCLickPage={(page) => setPage(page)}
              onClickSize={(size) => setSize(size)}
              setToken={(token) => setToken(token)}
            ></Applewatch>
          }
        ></Route>
        <Route path="/profile" element={<Profile></Profile>}></Route>
        <Route path="/product" element={<ProductPage></ProductPage>}></Route>
      </Routes>
      <Footer></Footer>
    </>
  );
}

export default App;
